import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  appBar: {
    margin: '10px 0px',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'flex',
    alignItems: 'center',
  },
  heading: {
    color: 'secondary',
  },
  image: {
    marginLeft: '15px',
  },
}));
